  [],\n\t\"num_tags\": 0,\n\t\"name\": \"drifting-buoy-and-other-data-as-part-of-the-outer-continental-shelf-environmental-assessment-pr\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Drifting buoy data was collected by the
  Atlantic Oceanographic and Meteorological Laboratory (AOML) as part of the Outer
  Continental Shelf Environmental Assessment Program (OCSEAP). Data were collected
  from 17 May 1976 to 23 December 1976. Data were processed by NODC to the NODC standard
  F156 Drifting Buoy Data format. Full format description is available from NODC at
  www.nodc.noaa.gov/General/NODC-Archive/f156.html. An analog file for this accession
  is available from NODC user service.nnThe F156 format is used for time series data
  on ocean circulation determined by the tracking of drifting buoys, drogues, or other
  instrumented devices as they are carried with the flow. Movement is reported as
  point-to-point geographic locations determined by shore-based, surface ship, aircraft,
  or satellite observations. Data from both ocean currents and ice movement can be
  reported in this format over time periods ranging from minutes to months. Directions
  and speeds between individual observations may be computed from these data and presented
  in graphic or summary listing form to provide information on circulation patterns
  and mass transport in offshore and near- shore regions. Platform name (for platform
  acquiring data or deploying device), drogue characteristics, start and end positions
  and times, and observation frequency (if constant time interval) are reported for
  each series of observation. Other surface meteorological or oceanographic parameters
  (e.g., water temperature and salinity, air temperature and pressure, wind, waves)
  and subsurface data (depth, pressure, temperature) may also be reported. Text records
  may be used to report general comments or to describe individual drogue observations.\",\n\t\"owner_org\":
